    def _extract_popup_data(self, company, global_index):
        """Extract data from the popup"""
        data = {
            'index': global_index + 1,
            'company_name': company['name'],
            'location': company['location'],
            'timestamp': datetime.now().strftime('%Y-%m-%d %H:%M:%S')
        }

        try:
            # Find popup container
            popup = None
            selectors = [
                ".modal-section",
                ".profile-details__business-data",
                ".modal.show",
                "[role='dialog']"
            ]

            for sel in selectors:
                try:
                    elements = self.driver.find_elements(By.CSS_SELECTOR, sel)
                    for elem in elements:
                        if elem.is_displayed() and len(elem.text.strip()) > 20:
                            popup = elem
                            break
                    if popup:
                        break
                except:
                    continue

            if not popup:
                return None

            # Extract email
            try:
                email_elem = popup.find_element(By.CSS_SELECTOR, ".exh-contact__email")
                email_text = email_elem.text.strip()
                if "E-mail:" in email_text:
                    data['email'] = email_text.replace("E-mail:", "").strip()
            except:
                pass

            # Extract phone
            try:
                phone_elem = popup.find_element(By.CSS_SELECTOR, ".exh-contact__phone")
                phone_text = phone_elem.text.strip()
                if "Phone:" in phone_text:
                    data['phone'] = phone_text.replace("Phone:", "").strip()
            except:
                pass

            # Extract website
            try:
                web_link = popup.find_element(By.CSS_SELECTOR, ".link-list a[href^='http']")
                href = web_link.get_attribute('href')
                if href and 'tradefair.com' not in href:
                    data['website'] = href
            except:
                pass

            # Extract address fields
            address_fields = {
                'street_address': '.address-street',
                'zip_code': '.address-zip',
                'city': '.address-city',
                'country': '.address-country'
            }

            for field, selector in address_fields.items():
                try:
                    elem = popup.find_element(By.CSS_SELECTOR, selector)
                    text = elem.text.strip()
                    if text:
                        data[field] = text
                except:
                    pass

            # Only return if we got useful data
            return data if len(data) > 4 else None

        except Exception as e:
            return None

    def _close_popup(self):
        """Close the popup modal"""
        try:
            # Try Escape key first (most reliable)
            self.driver.find_element(By.TAG_NAME, 'body').send_keys(Keys.ESCAPE)
            time.sleep(0.3)
            return
        except:
            pass

        # Try close button
        close_selectors = [
            ".close",
            ".modal-close",
            "[aria-label='Close']",
            "button[class*='close']"
        ]

        for selector in close_selectors:
            try:
                btn = self.driver.find_element(By.CSS_SELECTOR, selector)
                if btn.is_displayed():
                    self.driver.execute_script("arguments[0].click();", btn)
                    time.sleep(0.3)
                    return
            except:
                continue

