import requests
from selenium import webdriver
from selenium.webdriver.common.by import By
from selenium.webdriver.chrome.options import Options
from selenium.webdriver.chrome.service import Service
from selenium.common.exceptions import TimeoutException, WebDriverException
import pandas as pd
from urllib.parse import urlparse
import time
import random

class SerperDomainScraper:
    """
    Uses Serper API to get Google search results, then scrapes content from domains using Selenium.
    """

    def __init__(self, serper_api_key, headless=True, page_load_timeout=15):
        """
        Initialize the scraper.

        Args:
            serper_api_key (str): Your Serper API key from serper.dev
            headless (bool): Run Chrome in headless mode
            page_load_timeout (int): Timeout for page loads in seconds
        """
        self.serper_api_key = serper_api_key
        self.page_load_timeout = page_load_timeout
        self.domains = []
        self.search_results = []

        # Setup Chrome options
        self.chrome_options = Options()

        if headless:
            self.chrome_options.add_argument("--headless=new")

        # Essential options for stability
        self.chrome_options.add_argument("--no-sandbox")
        self.chrome_options.add_argument("--disable-dev-shm-usage")
        self.chrome_options.add_argument("--disable-blink-features=AutomationControlled")
        self.chrome_options.add_argument("--disable-gpu")
        self.chrome_options.add_argument("--window-size=1920,1080")
        self.chrome_options.add_argument("--disable-extensions")

        # User agent
        self.chrome_options.add_argument(
            "user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) "
            "AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36"
        )

        # Performance options
        prefs = {
            "profile.managed_default_content_settings.images": 2,
            "profile.default_content_setting_values.notifications": 2,
        }
        self.chrome_options.add_experimental_option("prefs", prefs)
        self.chrome_options.add_experimental_option("excludeSwitches", ["enable-automation"])

        self.driver = None

    def search_with_serper(self, query, num_results=10, location="us"):
        """
        Search using Serper API.

        Args:
            query (str): Search query
            num_results (int): Number of results to retrieve (max 100)
            location (str): Location for search (e.g., 'us', 'uk', 'in')

        Returns:
            list: List of search results with URLs and metadata
        """
        print(f"\n{'='*60}")
        print(f"üîç Searching via Serper API for: '{query}'")
        print(f"üìä Requesting: {num_results} results")
        print(f"{'='*60}\n")

        url = "https://google.serper.dev/search"

        payload = {
            "q": query,
            "num": num_results,
            "gl": location
        }

        headers = {
            'X-API-KEY': self.serper_api_key,
            'Content-Type': 'application/json'
        }

        try:
            print("üì° Making API request to Serper...")
            response = requests.post(url, json=payload, headers=headers)
            response.raise_for_status()

            data = response.json()

            # Extract organic results
            organic_results = data.get('organic', [])

            if not organic_results:
                print("‚ö†Ô∏è  No organic results found")
                return []

            print(f"‚úÖ Received {len(organic_results)} results from Serper API\n")

            # Process results
            self.search_results = []
            seen_domains = set()

            for idx, result in enumerate(organic_results, 1):
                link = result.get('link', '')
                title = result.get('title', '')
                snippet = result.get('snippet', '')

                if link:
                    parsed = urlparse(link)
                    domain = parsed.netloc

                    # Only add unique domains
                    if domain and domain not in seen_domains:
                        seen_domains.add(domain)
                        self.domains.append(domain)

                        result_data = {
                            'position': idx,
                            'domain': domain,
                            'url': link,
                            'title': title,
                            'snippet': snippet
                        }
                        self.search_results.append(result_data)

                        print(f"[{idx}] {domain}")
                        print(f"    üìÑ {title[:70]}...")

            print(f"\n‚úÖ Extracted {len(self.domains)} unique domains")

            return self.search_results

        except requests.exceptions.HTTPError as e:
            if e.response.status_code == 401:
                print("‚ùå Authentication Error: Invalid Serper API key")
                print("üí° Get your API key at: https://serper.dev/")
            elif e.response.status_code == 429:
                print("‚ùå Rate Limit Error: Too many requests")
                print("üí° Wait a bit or upgrade your Serper plan")
            else:
                print(f"‚ùå HTTP Error: {e}")
            return []
        except Exception as e:
            print(f"‚ùå Error calling Serper API: {e}")
            return []

    def start_driver(self):
        """Start the Chrome driver."""
        try:
            print("\nüöÄ Starting Chrome driver for domain scraping...")

            try:
                from webdriver_manager.chrome import ChromeDriverManager
                service = Service(ChromeDriverManager().install())
                self.driver = webdriver.Chrome(service=service, options=self.chrome_options)
            except ImportError:
                self.driver = webdriver.Chrome(options=self.chrome_options)

            self.driver.set_page_load_timeout(self.page_load_timeout)
            self.driver.implicitly_wait(5)

            print("‚úÖ Chrome driver started successfully\n")
            return True

        except WebDriverException as e:
            print(f"‚ùå Error starting Chrome driver: {e}")
            print("\nüí° Install with: pip install webdriver-manager")
            return False

    def close_driver(self):
        """Close the Chrome driver."""
        if self.driver:
            try:
                self.driver.quit()
                print("\n‚úÖ Chrome driver closed")
            except:
                pass

    def scrape_domain_content(self, domain, url):
        """
        Scrape content from a domain.

        Args:
            domain (str): Domain name
            url (str): Full URL to scrape

        Returns:
            dict: Scraped content
        """
        content = {
            'domain': domain,
            'url': url,
            'page_title': None,
            'meta_description': None,
            'h1_tags': [],
            'h2_tags': [],
            'main_content_preview': None,
            'status': 'failed'
        }

        try:
            self.driver.get(url)
            time.sleep(random.uniform(1, 2))

            # Get page title
            try:
                content['page_title'] = self.driver.title
            except:
                pass

            # Get meta description
            try:
                meta = self.driver.find_element(By.CSS_SELECTOR, "meta[name='description']")
                content['meta_description'] = meta.get_attribute("content")
            except:
                pass

            # Get H1 tags
            try:
                h1_elements = self.driver.find_elements(By.TAG_NAME, "h1")
                content['h1_tags'] = [h1.text.strip() for h1 in h1_elements if h1.text.strip()][:3]
            except:
                pass

            # Get H2 tags
            try:
                h2_elements = self.driver.find_elements(By.TAG_NAME, "h2")
                content['h2_tags'] = [h2.text.strip() for h2 in h2_elements if h2.text.strip()][:5]
            except:
                pass

            # Get main content preview (first paragraph or main text)
            try:
                paragraphs = self.driver.find_elements(By.TAG_NAME, "p")
                for p in paragraphs:
                    text = p.text.strip()
                    if len(text) > 50:  # Get first substantial paragraph
                        content['main_content_preview'] = text[:300]
                        break
            except:
                pass

            content['status'] = 'success'

        except TimeoutException:
            content['status'] = 'timeout'
        except Exception as e:
            content['status'] = f'error: {str(e)[:50]}'

        return content

    def scrape_all_domains(self, delay_range=(2, 4)):
        """
        Scrape content from all collected domains.

        Args:
            delay_range (tuple): Random delay between requests (min, max) in seconds

        Returns:
            list: List of dictionaries with scraped content
        """
        if not self.search_results:
            print("‚ùå No domains to scrape. Run search_with_serper() first.")
            return []

        if not self.driver and not self.start_driver():
            return []

        print(f"{'='*60}")
        print(f"üåê Starting to scrape {len(self.search_results)} domains...")
        print(f"{'='*60}\n")

        results = []

        for i, result in enumerate(self.search_results, 1):
            if i > 1:
                delay = random.uniform(*delay_range)
                print(f"‚è≥ Waiting {delay:.1f}s...")
                time.sleep(delay)

            domain = result['domain']
            url = result['url']

            print(f"[{i}/{len(self.search_results)}] Scraping: {domain}")

            # Scrape domain content
            scraped_content = self.scrape_domain_content(domain, url)

            # Combine Serper data with scraped content
            combined = {
                'position': result['position'],
                'domain': domain,
                'url': url,
                'serper_title': result['title'],
                'serper_snippet': result['snippet'],
                'page_title': scraped_content['page_title'],
                'meta_description': scraped_content['meta_description'],
                'h1_tags': scraped_content['h1_tags'],
                'h2_tags': scraped_content['h2_tags'],
                'main_content_preview': scraped_content['main_content_preview'],
                'scrape_status': scraped_content['status']
            }

            results.append(combined)

            status_icon = "‚úÖ" if scraped_content['status'] == 'success' else "‚ö†Ô∏è"
            print(f"   {status_icon} Status: {scraped_content['status']}")
            if scraped_content['page_title']:
                print(f"   üìÑ Title: {scraped_content['page_title'][:60]}...")

        print(f"\n{'='*60}")
        print(f"‚úÖ Domain scraping complete!")
        print(f"{'='*60}\n")

        return results

    def save_to_excel(self, results, filename="scraped_results.xlsx"):
        """Save results to Excel file."""
        if not results:
            print("‚ùå No results to save")
            return

        df = pd.DataFrame(results)

        # Convert lists to strings for Excel
        if 'h1_tags' in df.columns:
            df['h1_tags'] = df['h1_tags'].apply(lambda x: ' | '.join(x) if isinstance(x, list) else '')
        if 'h2_tags' in df.columns:
            df['h2_tags'] = df['h2_tags'].apply(lambda x: ' | '.join(x) if isinstance(x, list) else '')

        df.to_excel(filename, index=False)
        print(f"üíæ Results saved to: {filename}")


